<script>
    function TimKiem(){
        var type = $(""#select"").val();
        var input = $(""#input_search"").val();
        $.ajax({
            url: '/Admin/Brand/TimKiem',
            type: ""post"",
            dataType: ""json"",
            data: {
                type: type,
                input: input
            },
            success: function (data) {
                if (data != -1) {
                    var s = """";
                    for(let i = 0; i < data.length; ++i){
                        s += `<tr>
                                <td>`+ data[i].brand_id +`</td>
                                <td>`+ data[i].name +`</td>
                            </tr>`;
                    }
                    $(""#suath1"").html(s);
                }
            },
            error: function (e) {
                Swal.fire({
                    type: ""error"",
                    title: ""Lỗi tìm kiếm thương hiệu => TimKiem"",
                    html: e.responseText
          ");
            WriteLiteral(@"      });
            }
        });
    }

    $(document).ready(function () {
        $(""#myBtn"").click(function () {
            $(""#myModal"").modal();
        });
    });

    function cc() {
        $(""#myModal"").modal();
    }
</script>

</html>

